bio:
I've been an EdTech / eLearning Project Manager for over 6 years and currently in search of new opportunities in various fields of project management.

As a project manager, it's most importantly to me to build products of high quality while keeping my team in good mood and not lacking of resources they need! Good communication between the team and stakeholders is the key to my work, for that my organizational skills as well as interpersonal networking fit just right:)

My main responsibilities as EdTech / eLearning Project Manager included:
- Planning and launching of educational projects;
- Making the road map of the project development, including schedule, scope, budget, quality and resourses;
- Communication with stakeholders;
- Staff recruitment and management (developers, designers, trainers, teachers, mentors etc.);
- Development of partnership programs (government sector, academic and industry, fundraising); 
- Accomplishment of project documentation, contracts, presentations and financial reports;
- Working with users (custdev, handling enquiries, client retention);
- Participation in the development of marketing strategy, including marathons, quizzes, webinars, interviews and landing page layout;
- Dealing with suppliers (technical specifications, executing contracts, invoicing).
